style:
#resumecv-layout {
  width: 100%;
  max-width: 210mm;
  padding: 0;
    box-shadow: 0 3px 1px -2px rgba(0,0,0,.2), 0 2px 2px 0 rgba(0,0,0,.14), 0 1px 5px 0 rgba(0,0,0,.12);

  
}

#resumecv-main{

font-size: 14px;line-height: 24px;
display: flex;
flex-wrap: nowrap;
padding: 30px;
padding-top: 10px;
background-color: #ffff;
}

#rb-left .resumecv-block{
margin-bottom: 30px
}

#rb-left {
  width: 28%;
  padding:10px 5px;
  padding-right: 20px;
  padding-top: 20px;
  border:solid #d4d8dd;
  border-width: 2px 2px 0 0;
}
#resumecv-content {
  width: 72%;
  background: #fff;
  padding-left: 30px;
  padding-top: 20px;
  border:solid#d4d8dd;
  border-width: 2px 0 0 0;
}



#resumecv-content-top{	
  background:#ffff;
  padding: 30px;
  padding-bottom: 10px;
  padding-top: 40px;
  display: flex;
}
   #resumecv-top-info-img{
         width:70%;
         border: solid #d4d8dd;
         border-width: 0 2px 2px 0;
        
      }
      /* #resumecv-top-info-img .resumecv-top-info{
         padding-top: 34px;
         padding-left: 40px;
      } */
      

      #resumecv-box-ava img{
        width:100px;
      }
      #resumecv-top-info-contact{
        width: 30%;
        padding-left:20px;
        font-size: 16px;
        border: solid #d4d8dd;
        border-width: 0 0 2px 0;

      }
#resumecv-content-top .resumecv-block {
    position: relative;
    display: flex;
}
#resumecv-content-top .resumecv-block  img{
    width:80px;
    border-radius: 5%;
}

#resumecv-content .resumecv-block {
  position: relative;
  padding: 5px 10px;
}
#rb-left .resumecv-box-content {
padding-bottom: 0;
margin:0;
}
.skill{
margin-top: 15px
}

#resumecv-content-top h1{
font-size: 35px;	
margin:0;
color:#383838;
padding-top: 0px;
line-height: normal;
letter-spacing: 3px;
text-transform: capitalize;
font-weight: 800;
}
#resumecv-content-top .job_position{
    font-size: 22px;
    color: #969696;
    font-weight: bold;
    margin-top: 15px;
    letter-spacing: 1px;

}

#resumecv-content-top h1 span{
display:block
}


.box-name p{		
  overflow: hidden;
}
.box-name{		
overflow: hidden;
background: #2f3a40;
}
#resumecv-content p{
margin-bottom: 5px
}
#rb-left .h3{
    font-size: 18px;
  font-weight: bold;
  margin-top: 0;
  text-transform: uppercase;
}
#resumecv-content .head{
  font-size: 18px;
  color: #2f3a40;
  padding-bottom: 5px;
  /* border-bottom: 2px solid #9B9C8F; */
  font-weight: bold;
  margin-top: 0;
  text-transform: uppercase;
}

#resumecv-top-bottom{	
  background:#ffff;
  padding: 10px 30px 10px 30px;
  display: flex;
}
#resumecv-top-bottom .head{
  font-size: 18px;
  color: #2f3a40;
  padding-bottom: 5px;
  padding-top: 10px;
  /* border-bottom: 2px solid #9B9C8F; */
  font-weight: bold;
  margin-top: 0;
  text-transform: uppercase;
}
#resumecv-content h3{
  font-weight:bold;font-size: 14px;line-height:30px;margin-bottom: 10px;color: #333;
}


#resumecv-content span{
display: inline-block;
padding-right: 15px;
padding-left: 15px;
}

#rb-left .h3:first-child{
margin-top: 0
}
.resumecv-box-content{
margin-bottom: 25px;
padding-left: 15px;
position: relative;
}

#resumecv-box-ava{	
text-align:center;padding:2px;margin-bottom: 10px; auto;
}
#resumecv-box-ava img{
padding: 0;
border:0;
width: 150px;
height: 150px;

}
.bar-exp span {
  display:block;
  height: 8px;
  background: #d9d9d9;
}
.bar-exp{
background: #2f3a40;
border: solid 2px white;
  margin-bottom: 12px;
}
.icoweb label{
display: block;
color:#627e88;
}
.icoweb span{
display: block;
}

.box-contact{
font-size: 13px;
padding-top:0px;
}

.icoweb i.fa, .icoweb i.fab, .icoweb i.far{
  width: 20px;
  height: 20px;
  background-color:#ffff;
  border-radius: 50%;
  -webkit-border-radius: 50%;
  -moz-border-radius: 50%;
  display: inline-block;
  text-align: center;
  font-size: 13px;
  line-height: 20px;
  color: #2f3a40!important;
  margin-right: 10px;
  margin-top: 3px;float:left
}
.head i{
  font-size: 25px;
  margin-right: 10px;
}

#resumecv-content span.exp-date {
  float: right;
}
.icon_fa{
text-align: center;
}
.icon_fa i.fa{
font-size: 20px;
border: solid 1px #ffffff;
border-radius: 50%;
padding: 5px;
width: 20px;
color: white;
background: #ffffff;
margin-bottom: 5px;
}
p.head i.fa{float:left}
.rb-skillrate-value[value="1"]{width:20%}
 .rb-skillrate-value[value="2"]{width:40%}
 .rb-skillrate-value[value="3"]{width:60%}
 .rb-skillrate-value[value="4"]{width:80%}
 .rb-skillrate-value[value="5"]{width:100%}

 .resumecv-box-content-skill span.fa {
    margin-right: 8px;
    font-size: 18px;
}
.resumecv-box-content-skill span.fa.checked {
    color: #FFC531;
}
